    const url = 'https://pokeapi.co/api/v2/pokemon/2'
    fetch(url)
    .then(res=> {const data=res.json()})
    .then(console.log(data))
    .catch(err => console.log(err))
})
const pokeCard = () =>{
    return (
        <div className='pokemones'>
            <h1>HOLA</h1>
        </div>
    )
}
